import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link } from "react-router-dom";
import Newproduct from "./Newproduct";
import Newcategory from "./Newcategory";
import styles from "./Header.module.css";
import { signOut } from "../../redux/features/application";
import basket from "../../assets/basket.png";
import Basket from "./Basket/Basket";
import { addCashIn } from "../../redux/features/user";

// import { signOut } from "../../redux/features/application";

const Title = () => {
  const dispatch = useDispatch();
  const token = useSelector((state) => state.application.token);
  const role = useSelector((state) => state.application.role);
  const cash = useSelector((state) => state.user.cash);
  const login = useSelector((state) => state.application.login);
  const messageLogIn = useSelector((state) => state.application.message);
  const [addProduct, setAddProduct] = useState(false);
  const [addCategory, setAddCategory] = useState(false);
  const [openBasket, setOpenBasket] = useState(false);
  const [sumCash, setSumCash] = useState(false);
  const [cashMessage, setCashMessage] = useState(false);
  const handleOpenLogoutForm = () => {
    dispatch(signOut());
  };
  const handleAddProduct = () => {
    addCategory && setAddCategory(false);
    addProduct ? setAddProduct(false) : setAddProduct(true);
  };
  const handleAddCategory = () => {
    addCategory ? setAddCategory(false) : setAddCategory(true);
    addProduct && setAddProduct(false);
  };
  const handleOpenBasket = () => {
    if (openBasket) {
      setOpenBasket(false);
    } else {
      setOpenBasket(true);
    }
  };
  const handleAddCashIn = () => {
    dispatch(addCashIn(login, sumCash));
    setSumCash(false);
  };
  const handleOpenCashIn = () => {
    sumCash ? setSumCash(false) : setSumCash(true);
  };
  return (
    <div className={styles.Header}>
      <div className={styles.title}>
        <h1 className={styles.myShop}>
          <Link to="/" className={styles.link}>
            My Online Shop
          </Link>
        </h1>
        <div>
          {token && role === "admin" ? (
            <div className={styles.headerBlock}>
              <div onClick={handleAddProduct} className={styles.addNewProduct}>
                добавить продукт
              </div>
              <div className={styles.addNewProduct} onClick={handleAddCategory}>
                добавить категорию
              </div>
              {addProduct && <Newproduct />}
              {addCategory && <Newcategory />}
              <div>
                <h4>{messageLogIn}</h4>
              </div>
              <div>
                <span
                  onClick={handleOpenLogoutForm}
                  className={styles.buttonLog}
                >
                  Выйти
                </span>
              </div>
            </div>
          ) : token && role === "user" ? (
            <div className={styles.userLK}>
              <div>
                <span>{`На вашем счету ${cash}`}₽</span>
                <div onClick={handleOpenCashIn}>Пополнить</div>
                <div className={styles.cash}>
                  <input type="number" />
                  <input
                    type="submit"
                    value="Пополнить"
                    onClick={handleAddCashIn}
                  />
                </div>
                <div className={styles.messageCash}>{messageCash}</div>
              </div>

              <div className={styles.basket}>
                <img src={basket} onClick={handleOpenBasket} alt="" />
              </div>
              {openBasket && <Basket />}
              <div>
                <span>{messageLogIn}</span>
              </div>
              <div>
                <span
                  onClick={handleOpenLogoutForm}
                  className={styles.buttonLog}
                >
                  Выйти
                </span>
              </div>
            </div>
          ) : (
            <div>
              <Link to="/login" className={styles.buttonLog}>
                Войти
              </Link>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Title;
